import React from "react";

function Tracklist(props) {
    return(
        <div>

                <ul>{props.strings.map((string, i) => 
                        <li 
                            key={'string' + i}
                            className=""
                            onClick={() => props.onSelectItem(string)}
                        >
                            <div>{string.name}</div>
                            <div>{string.artist}</div>
                            <div>{string.album}</div>
                        </li> )}
                </ul>        
     
        </div>
    )
};

export default Tracklist;
